import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'; // Import BrowserRouter as Router

import FormEditor from './components/FormEditor';
import FormPreview from './components/FormPreview';

function App() {
  return (
    <Router> {/* Wrap your components with BrowserRouter */}
      <div>
        <Switch>
          <Route exact path="/" component={FormEditor} />
          <Route path="/preview" component={FormPreview} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
